import logo from './logo.svg';
import './Carto.css';

import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'
import highchartsMap from "highcharts/modules/map";
import React from 'react'
import map from './fr-all.geo.json'

highchartsMap(Highcharts);
/*
const getTopology = async () => {
    const topology = await fetch(
      'https://code.highcharts.com/mapdata/countries/fr/fr-all.topo.json'
    ).then(response => {
      return response.json()
    });
  };
*/
function App() {

const data = [
  ['fr-cor', 10], ['fr-bre', 11], ['fr-pdl', 12], ['fr-pac', 13],
  ['fr-occ', 14], ['fr-naq', 15], ['fr-bfc', 16], ['fr-cvl', 17],
  ['fr-idf', 18], ['fr-hdf', 19], ['fr-ara', 20], ['fr-ges', 45],
  ['fr-nor', 22], ['fr-lre', 23], ['fr-may', 24], ['fr-gf', 25],
  ['fr-mq', 26], ['fr-gua', 27]
];


const mapOptions = {
  chart: {
    map

  },
  title: {
      text: 'Highcharts Maps basic demo '
  },  
  mapNavigation: {
    enabled: true,
    buttonOptions: {
        verticalAlign: 'bottom'
    }
}
};

  return (
    <div className="App">
      <HighchartsReact
        options={mapOptions}
        highcharts={Highcharts}
        constructorType ={'mapChart'}
      />
    </div>
  );
}

export default App;
